export const initialValue = {
    mainPosts: [
        {
            id: 1,
            User: {
                id: 1,
                nickname: "이현철",
            },
            content: "첫 번째 게시글 #해시태그 #익스프레스",
        },
    ],
};

const reducer = (state = initialValue, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default reducer;
